import React from 'react';
import './GraphicCard.css'
import posed, {PoseGroup} from 'react-pose';

const Change = posed.div({
    enter: {color: 'white'},
    exit: {color: 'black'}
})

const GraphicCard = () =>{
    return(
        <div className="graphicContainer">
            <Change className="logo">
                <h1>CO</h1>
                <h1>DE;</h1>
                <span>;</span>
            </Change>
        </div>
    )
}

export default GraphicCard;
